import React from 'react';
import styled from 'styled-components';

const StyledLogout = styled`
    padding: 2em 0;
`;

const Logout = (props) => {
    return (
        <StyledLogout>Are you sure you want to log out?</StyledLogout>
    );
}

export default Logout;
